export default class Color {
    color: string | {
        hex: string;
        rgb: string;
        hsl: string;
        hsv: string;
        cmyk: string;
    } | any;
    colorSystem: string | null;
    imageUrl: string;
    constructor(color?: string);
    toHex(): string;
    toRgb(): string;
    toHsl(): string;
    toHsv(): string;
    toCmyk(): string;
    toArray(): Array<string> | {
        hex: Array<string>;
        rgb: Array<string>;
        hsl: Array<string>;
        hsv: Array<string>;
        cmyk: Array<string>;
    };
}
